import React from 'react';
import './style/global.css';
import './style/pages/landing.css';
import LogoImg from './images/logo.svg'
function App() {
  return (
    <div id="page-landing">
      <div className="contente-wrapper">
        <img  src={LogoImg} alt="Happy"/>
      </div>
    </div>
  );
}

export default App;
